

-- ----------------------------
-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS "velzy"."orders";
CREATE TABLE "velzy"."orders" (
  "id" bigserial primary key,
  "body" jsonb NOT NULL,
  "search" tsvector,
  "created_at" timestamptz(6) NOT NULL DEFAULT now(),
  "updated_at" timestamptz(6) NOT NULL DEFAULT now()
)
;
ALTER TABLE "velzy"."orders" OWNER TO "rob";

-- ----------------------------
-- Records of orders
-- ----------------------------
BEGIN;
COMMIT;

create trigger orders_notify_change AFTER INSERT OR UPDATE OR DELETE ON velzy.orders
FOR EACH ROW EXECUTE PROCEDURE velzy.notify_change();

